def bathroom_meow(input)
	keys = [[1,2,3],[4,5,6],[7,8,9]]
	start = [1,1]
	answer = []
	input.split("\n").each do |line|
		code = line.split("")
		code.each do |movement|
			if movement == "U"
				unless start[0] == 0
					start[0] -= 1
				end
			elsif movement == "D"
				unless start[0] == 2
					start[0] += 1
				end
			elsif movement == "L"
				unless start[1] == 0
					start[1] -= 1
				end
			else
				unless start[1] == 2
					start[1] += 1
				end
			end
		end
		answer << keys[start[0]][start[1]]
	end
	p answer.join("")
end

input = "



"
bathroom_meow(input)


